import { useSelector } from "react-redux";
import { useRouter } from "next/router";

import Banners from "../components/shop/Banners";
import LayoutOne from "../components/layouts/LayoutOne";
import latestProductShopLayout from "../components/shop/latestProductShopLayout";
import latestproductData from "../data/latestProduct.json";
import useProductData from "../common/useProductData";

export default function Home() {
  const router = useRouter();
  const globalState = useSelector((state) => state.globalReducer);
  const data = useProductData(
    latestproductData,
    globalState.category,
    router.query.q
  );
  return (
    <LayoutOne title="Home">
      <Banners />
      <latestProductShopLayout data={[...data]} />
    </LayoutOne>
  );
}
